import styled from 'styled-components';

export const HeaderContainer = styled.header`
  position: relative;
  display: flex;
  align-items: center;
  min-width: 320px;
`;

export const LogoThumb = styled.div`
  padding-left: 135px;
  padding-top: 24px;
`;

export const HeaderLinkArea = styled.a`
  padding: 15px 0;
`;

export const MenuContainer = styled.div`
  padding-left: 83px;
  padding-top: 49px;
`;

export const SiteNav = styled.ul`
  display: flex;
  gap: 50px;
  list-style: none;
`;

export const SiteNavItem = styled.li`
  margin-bottom: 32px;
`;

export const SiteNavLink = styled.a`
  font-family: 'Josefin Sans', sans-serif;
  font-style: normal;
  font-weight: 600;
  font-size: 20px;
  line-height: 28px;
  color: #E4E2DD;
  text-decoration: none;
`;
